enterMapName:"Ingrese nombre del mapa",mapName:"Nombre del mapa",disableAllTips:"Desactivar TODAS consejos",aboutText:"<br><br><br>Ancient Empire:<br>Strike Back<br><br><br>",instructionsText:"'Ancient Empire: Strike Back' es un juego de estrategia emocionante que te permite controlar Rey Galamar y su hermano Valadorn mientras luchan para proteger su reino del mal.;A continuaci\u00f3n se muestran las instrucciones, consejos y sugerencias sobre c\u00f3mo jugar, que tambi\u00e9n aparecen en el juego.;Los cuadros rojos marcan el rango de movimiento de una unidad. El rango de una unidad se determina por su tipo y el terreno que se encuentra.;Los diferentes tipos de terreno afectan la capacidad de una unidad para moverse, atacar y defender. Por ejemplo, las monta\u00f1as a\u00f1aden puntos de defensa, pero reducen el movimiento. Al mover el cursor estas caracter\u00edsticas del terreno aparecen estas caracteristicas en la parte inferior de la pantalla.;Cuando una unidad ha completado un movimiento, cambiar\u00e1 a gris. Esto significa que no puede ser utilizado de nuevo hasta su pr\u00f3ximo turno.;Puede mover cada unidad s\u00f3lo una vez cada turno. Cuando haya terminado de mover todas sus unidades toque 'terminar turno'.;Las unidades se vuelven mas poderosas a medida que adquieren experiencia en batalla y se actualizan en rango.;Puede ver el rango de ataque de cualquier unidad dando doble toque cuando se selecciona.;Para atacar a una unidad enemiga, mueve tu unidad dentro del rango y selecciona 'atacar'. En caso de haber m\u00e1s de un enemigo al alcanze, selecciona cu\u00e1l unidad deseas atacar. El \u00e9xito de tu ataque est\u00e1 determinado por las caracter\u00edsticas de la unidad y el terreno.;S\u00f3lo un comandante puede ocupar un castillo. Una vez que un castillo es ocupado puedes adquirir nuevas unidades con tu oro. El comandante no necesita permanecer en el castillo para adquirir unidades.;Puedes ocupar edificios moviendo a un soldado o comandante dentro de ellos y seleccionando \"ocupar\". Una vez un edificio es ocupado, cambia su color. Si un edificio es da\u00f1ado tendr\u00e1s que repararlo antes de que pueda ser ocupado.;Una vez que un edificio ha sido ocupado, generar\u00e1 oro. Mientras m\u00e1s edificios ocupes, m\u00e1s oro recibir\u00e1s;Las unidades pueden ser curadas en los edificios de tu propiedad. Mientras m\u00e1s tiempo pase una unidad en el edificio, ser\u00e1 mayor la energ\u00eda que recuperar\u00e1. ;Si un comandante es derrotado en batalla, puede ser revivido en un castillo.;Los elementales son anfibios, lo que les da un incremento de movimiento, ataque y defensa mientras permanescan en el agua.;Un ataque hecho por lobos es venenoso. Una unidad envenenada es lenta y d\u00e9bil hasta su siguiente turno.;Una hechicera tiene el poder para invocar guerreros esqueleto de las tumbas de las unidades ca\u00eddas. Despu\u00e9s que una unidad ha sido derrotada, una l\u00e1pida aparece por un turno. Mueve a la hechicera al lado de una l\u00e1pida y selecciona 'resucitar'.;Usa los fragmentos para proporcionar a tus unidades cercanas un aura que aumenta sus puntos de ataque.;La catapulta tiene la habilidad para destruir edificios enemigos e interrumpir su flujo de recursos.;Mant\u00e9n a tus dragones lejos de arqueros enemigos, \u00a1ellos son vulnerables a las flechas!".split(";"),
